from collections import Counter

def lengthOfLongestSubstringKDistinct( s: str, k: int) -> int:
    if len(s) <= k:
        return len(s)

    max_len = k

    d = Counter(s[0: k])

    for i in range(len(s) - k):

        print(d)
        if i > 0:

            if d[s[i - 1]] > 1:
                d[s[i - 1]] -= 1
            else:
                del d[s[i - 1]]

            if i + max_len >= len(s): return max_len

            if s[i + max_len-1] in d:
                d[s[i + max_len-1]] += 1
            else:
                d[s[i + max_len-1]] = 1

        # print(d)

        while i + max_len < len(s) and len(d) <= k:
            if s[i + max_len] in d:
                max_len += 1
                if i + max_len >= len(s): return max_len
                d[s[i + max_len]] += 1
            else:
                if len(d) < k:
                    max_len += 1
                    if i + max_len >= len(s): return max_len
                    d[s[i + max_len]] += 1
                else:
                    break
            # print(d)

    return max_len


if __name__ == '__main__':

    s=""
    k = 34

    print(lengthOfLongestSubstringKDistinct(s, k))